CREATE TABLE physiotherapy(
   placeUrl      VARCHAR(400) NOT NULL PRIMARY KEY
  ,title         VARCHAR(90) NOT NULL
  ,rating        NUMERIC(3,1)
  ,reviewCount   INTEGER 
  ,category      VARCHAR(10)
  ,attributes    VARCHAR(30)
  ,address       VARCHAR(102)
  ,plusCode      VARCHAR(15)
  ,website       VARCHAR(171)
  ,phoneNumber   VARCHAR(14)
  ,currentStatus VARCHAR(4)
  ,imgUrl        VARCHAR(162)
  ,isClaimed     VARCHAR(5) NOT NULL
  ,latitude      NUMERIC(18,15)
  ,longitude     NUMERIC(18,14)
  ,query         VARCHAR(91) NOT NULL
  ,timestamp     VARCHAR(24) NOT NULL
  ,星期三           VARCHAR(24)
  ,星期四           VARCHAR(24)
  ,星期五           VARCHAR(24)
  ,星期六           VARCHAR(24)
  ,星期日           VARCHAR(24)
  ,星期一           VARCHAR(24)
  ,星期二           VARCHAR(24)
  ,info          VARCHAR(11)
);
